import React from 'react';
import {
  Box,
  Typography,
  Card,
  CardContent,
  Chip,
  Grid,
} from '@mui/material';
import {
  Share,
  InsertDriveFile,
  Folder,
} from '@mui/icons-material';

const SharedPage: React.FC = () => {
  // Mock shared items for demonstration
  const sharedItems = [
    {
      id: '1',
      name: 'Project Presentation.pptx',
      type: 'file',
      sharedBy: 'john.doe@example.com',
      sharedDate: '2024-01-15',
      permission: 'edit',
    },
    {
      id: '2',
      name: 'Marketing Assets',
      type: 'folder',
      sharedBy: 'jane.smith@example.com',
      sharedDate: '2024-01-10',
      permission: 'view',
    },
  ];

  return (
    <Box>
      <Typography variant="h4" gutterBottom>
        Shared with me
      </Typography>
      <Typography variant="body1" color="text.secondary" paragraph>
        Files and folders that others have shared with you.
      </Typography>

      <Grid container spacing={2}>
        {sharedItems.map((item) => (
          <Grid item xs={12} key={item.id}>
            <Card>
              <CardContent>
                <Box display="flex" alignItems="center" justifyContent="space-between">
                  <Box display="flex" alignItems="center">
                    {item.type === 'file' ? (
                      <InsertDriveFile color="secondary" sx={{ mr: 2 }} />
                    ) : (
                      <Folder color="primary" sx={{ mr: 2 }} />
                    )}
                    <Box>
                      <Typography variant="h6">{item.name}</Typography>
                      <Typography variant="body2" color="text.secondary">
                        Shared by {item.sharedBy} on {item.sharedDate}
                      </Typography>
                    </Box>
                  </Box>
                  <Box>
                    <Chip
                      size="small"
                      label={item.permission}
                      color={item.permission === 'edit' ? 'primary' : 'default'}
                      icon={<Share />}
                    />
                  </Box>
                </Box>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>

      {sharedItems.length === 0 && (
        <Box
          display="flex"
          flexDirection="column"
          alignItems="center"
          justifyContent="center"
          sx={{ py: 8 }}
        >
          <Share sx={{ fontSize: 64, color: 'text.disabled', mb: 2 }} />
          <Typography variant="h6" color="text.secondary" gutterBottom>
            No shared items
          </Typography>
          <Typography variant="body2" color="text.secondary">
            Files and folders shared with you will appear here
          </Typography>
        </Box>
      )}
    </Box>
  );
};

export default SharedPage;
